        /// <value>Rule type for this definition. Valid operation values include &lt;ul&gt;   &lt;li&gt;     &lt;h3&gt;internal-space&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; contains some internal packable subspace that can be used to place subsequent &lt;b&gt;items&lt;/b&gt; defined by a virtual &lt;b&gt;boxType&lt;/b&gt; with an &lt;b&gt;origin&lt;/b&gt; defined relative to the &lt;b&gt;item&lt;/b&gt;&#39;s &lt;b&gt;dimensions&lt;/b&gt; and with an allowable &lt;b&gt;weightMax&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;The internal subspace is subject to all rules and parameters of the parent &lt;b&gt;box&lt;/b&gt; of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;Subspaces may nest, as in a pencil can be placed into a flower pot which may then be put inside a bucket which may then be put inside a single &lt;b&gt;box&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;Internal space subspaces are \&quot;opened\&quot; only when an &lt;b&gt;item&lt;/b&gt; with an internal space is placed into a &lt;b&gt;box&lt;/b&gt;. They are then treated preferentially over opening a new &lt;b&gt;box&lt;/b&gt; from the specified &lt;b&gt;boxTypes&lt;/b&gt; until their weight or volume is exhausted, or no valid placements can be found within them for remaining &lt;b&gt;items&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;string&lt;/td&gt;&lt;td&gt;identifies this internal space as being defined by a subspace.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;boxType&lt;/td&gt;&lt;td&gt;BoxType&lt;/td&gt;&lt;td&gt;BoxType definition, values specified are used except price and rate and unless superseded by parent BoxType attributes.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;origin&lt;/td&gt;&lt;td&gt;Point&lt;/td&gt;&lt;td&gt;origin of the subspace relative to Item dimensions.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;blocking&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;whether the bounding box of the internal space blocks placement of other items in the parent box.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the bounding box of the internal space as a white semi-transparent object in the visualization of its containing Item.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;displayChildren&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the children packed within the internal space in the visualization of its containing parent Box.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{ \&quot;operation\&quot;: \&quot;internal-space\&quot;, \&quot;itemRefId\&quot;: 0, \&quot;options\&quot;: {   \&quot;type\&quot;: \&quot;subspace\&quot;,    \&quot;boxType\&quot;: {     \&quot;weightMax\&quot;: 2,     \&quot;name\&quot;: \&quot;flower pot interior\&quot;,     \&quot;price\&quot;: 0,     \&quot;dimensions\&quot;: {       \&quot;x\&quot;: 1.5,       \&quot;y\&quot;: 1.5,       \&quot;z\&quot;: 1.5     }   },   \&quot;origin\&quot;: {     \&quot;x\&quot;: 0.25,     \&quot;y\&quot;: 1,     \&quot;z\&quot;: 1   },   \&quot;blocking\&quot;: true,   \&quot;display\&quot;: true,   \&quot;displayChildren\&quot;: true }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;alternate-dimensions&lt;/h3&gt;     &lt;p&gt;Specify a set of alternate dimensions to attempt when packing in addition to the primary &lt;b&gt;dimensions&lt;/b&gt; attribute of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;dimensions&lt;/td&gt;&lt;td&gt;[]Point&lt;/td&gt;&lt;td&gt;A list of possible dimensions that will be attempted. Dimensions are sorted by volume ascending.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{       \&quot;operation\&quot;: \&quot;alternate-dimensions\&quot;,       \&quot;itemRefId\&quot;: 0,       \&quot;options\&quot;: {         \&quot;dimensions\&quot;: [{           \&quot;x\&quot;: 6,           \&quot;y\&quot;: 8,           \&quot;z\&quot;: 16         },         {           \&quot;x\&quot;: 7.5,           \&quot;y\&quot;: 10,           \&quot;z\&quot;: 10         }]       }     }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;exclude&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all &lt;b&gt;targetItemRefIds&lt;/b&gt;&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;targetItemRefIds\&quot;: [1,2] }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;exclude-all&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all items without its refId&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude-all\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;pack-as-is&lt;/h3&gt;     &lt;p&gt;Each individual item with &lt;b&gt;itemRefId&lt;/b&gt; is packed in a carton matching its exact dimensions, i.e., it is assumed the item is ship-ready and bypasses being placed in a box. If you have an item quantity of 6, it will place the items in 6 boxes.&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;pack-as-is\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;irregular&lt;/h3&gt;     &lt;p&gt;There are two types of irregular item packings right now, \&quot;nesting\&quot; and \&quot;roll\&quot;.&lt;/p&gt;     &lt;ul&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;nesting\&quot;&lt;/h4&gt;          &lt;p&gt;\&quot;nesting\&quot; is where the first item has full dimensions, and subsequent items have diminished dimensions. E.g.,         a flower pot may have dimensions of 6\&quot; x 6\&quot; x 6\&quot;, but additional flower pots can nest in the first pot, and have         effective dimensions of 1\&quot; x 6\&quot; x 6\&quot;. These cases are almost always have a single direction that nesting can occur         in- -two pots must both be right-side up and one on top of the other if they are to nest- -so the rule options must         reflect these restrictions.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;nesting\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsX&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsY&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsZ&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingOrientation&lt;/td&gt;&lt;td&gt;0, 1, or 2&lt;/td&gt;&lt;td&gt;axis index of direction of stacking (0 for vertical/X/\&quot;dinner plates\&quot;, 1 for shorter-horizontal/Y/\&quot;shopping carts\&quot;, 2 for long-horizontal/Z/\&quot;newsstand magazines\&quot;)&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingLimit&lt;/td&gt;&lt;td&gt;&lt;i&gt;integer&lt;/i&gt;&lt;/td&gt;&lt;td&gt;total number of nested items allowed in a single \&quot;stack\&quot;&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;         &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;nesting\&quot;,     \&quot;additionalDimensionsX\&quot;: 1.0,     \&quot;additionalDimensionsY\&quot;: 6.0,     \&quot;additionalDimensionsZ\&quot;: 6.0,     \&quot;nestingOrientation\&quot;: 0,     \&quot;nestingLimit\&quot;: 5   } }&lt;/pre&gt;       &lt;/li&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;roll\&quot;&lt;/h4&gt;          &lt;p&gt;A rolled irregular item is simply where the item dimensions X, Y, and Z, represent the thickness, width, and total         length of a material meant to be rolled up (possibly on a spool, dowel, etc.) and shipped as such. Marked this way, the bounding box         of the roll cylinder will be used as its shipping dimensions. E.g., a roll has a width 60 inches and a diameter of 12 inches,         it will be shipped as if it were a 12\&quot; x 12\&quot; x 60\&quot; item. Rolls can have a maximum allowable diameter, and any rolls that must be         split will have their weights calculated on a pro-rated basis of the total length and weight in the item contents.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;roll\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;innerDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the inner diameter of any dowel or tube used that serves as the initial diameter of the roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;spoolWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the additional weight of each spool or dowel if applicable&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable diameter of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable weight of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;minRollLength&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the minimum length above which rolling will occur. E.g., if less than 12\&quot; remain, ship it flat without rolling.&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;       &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;roll\&quot;,     \&quot;innerDiameter\&quot;: 1.0,     \&quot;spoolWeight\&quot;: 1.0,     \&quot;maxDiameter\&quot;: 8.0,     \&quot;maxWeight\&quot;: 150,     \&quot;minRollLength\&quot;: 12   } }&lt;/pre&gt;       &lt;/li&gt;     &lt;/ul&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;lock-orientation&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is locked from rotation of its original dimensions, with axes of rotation excepted by &lt;b&gt;freeAxes&lt;/b&gt;&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;freeAxes&lt;/td&gt;&lt;td&gt;array&lt;/td&gt;&lt;td&gt;Array of axis indices to be allowed rotational freedom. E.g., [0] for only yaw allowed, [0,1] for yaw and roll.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;lock-orientation\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;freeAxes\&quot;: [0,1]   } }&lt;/pre&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;fragile&lt;/h3&gt;      &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; gains conditions for its packing and the packing of items directly above it. Fragile items can be wrapped in a thickness of packing material that is added to each face of the item, or marked as only to be packed on top of other items, or a maximum weight can be given for all additional items supported by the fragile item, or a simple priority flag can be specified where fraile items with the highest priority are never packed underneath items with a lower or unspecified priority.&lt;p/&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;     &lt;table&gt;       &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;whether to display the virtual subspace created above fragile items for analysis purposes.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum weight of items that may be placed above this fragile item.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;onTopOnly&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;specifies that nothing will be placed between the top dimensions of this item and the top of the box or container it is packed within, overriding &lt;b&gt;maxWeight&lt;/b&gt; if previously specified.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;packingMaterialThickness&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a thickness of padding to apply to each face of the fragile item. E.g., a 3\&quot;x3\&quot;x3\&quot; item with 0.5\&quot; of &lt;b&gt;packingMaterialThickness&lt;/b&gt; will be packed as a 4\&quot;x4\&quot;x4\&quot; volume, as the 0.5\&quot; of material will be applied once to each of the top, bottom, front, back, left, and right sides.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;priority&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a priority integer, where higher values will never be placed underneath lower (or unspecified) values.&lt;/td&gt;&lt;/tr&gt;     &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;fragile\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;display\&quot;: false,     \&quot;onTopOnly\&quot;: false,     \&quot;maxWeight\&quot;: 5,     \&quot;packingMaterialThickness\&quot;: 0.2,     \&quot;priority\&quot;: 0   } }&lt;/pre&gt;   &lt;/li&gt; &lt;/ul&gt; </value>
        [JsonConverter(typeof(StringEnumConverter))]
        public enum OperationEnum
        {
            
            /// <summary>
            /// Enum Exclude for value: exclude
            /// </summary>
            [EnumMember(Value = "exclude")]
            Exclude = 1,
            
            /// <summary>
            /// Enum ExcludeAll for value: exclude-all
            /// </summary>
            [EnumMember(Value = "exclude-all")]
            ExcludeAll = 2,
            
            /// <summary>
            /// Enum PackAsIs for value: pack-as-is
            /// </summary>
            [EnumMember(Value = "pack-as-is")]
            PackAsIs = 3,
            
            /// <summary>
            /// Enum Irregular for value: irregular
            /// </summary>
            [EnumMember(Value = "irregular")]
            Irregular = 4,
            
            /// <summary>
            /// Enum LockOrientation for value: lock-orientation
            /// </summary>
            [EnumMember(Value = "lock-orientation")]
            LockOrientation = 5,
            
            /// <summary>
            /// Enum InternalSpace for value: internal-space
            /// </summary>
            [EnumMember(Value = "internal-space")]
            InternalSpace = 6,
            
            /// <summary>
            /// Enum AlternateDimensions for value: alternate-dimensions
            /// </summary>
            [EnumMember(Value = "alternate-dimensions")]
            AlternateDimensions = 7,
            
            /// <summary>
            /// Enum Fragile for value: fragile
            /// </summary>
            [EnumMember(Value = "fragile")]
            Fragile = 8
        }

        /// <summary>
        /// Rule type for this definition. Valid operation values include &lt;ul&gt;   &lt;li&gt;     &lt;h3&gt;internal-space&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; contains some internal packable subspace that can be used to place subsequent &lt;b&gt;items&lt;/b&gt; defined by a virtual &lt;b&gt;boxType&lt;/b&gt; with an &lt;b&gt;origin&lt;/b&gt; defined relative to the &lt;b&gt;item&lt;/b&gt;&#39;s &lt;b&gt;dimensions&lt;/b&gt; and with an allowable &lt;b&gt;weightMax&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;The internal subspace is subject to all rules and parameters of the parent &lt;b&gt;box&lt;/b&gt; of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;Subspaces may nest, as in a pencil can be placed into a flower pot which may then be put inside a bucket which may then be put inside a single &lt;b&gt;box&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;Internal space subspaces are \&quot;opened\&quot; only when an &lt;b&gt;item&lt;/b&gt; with an internal space is placed into a &lt;b&gt;box&lt;/b&gt;. They are then treated preferentially over opening a new &lt;b&gt;box&lt;/b&gt; from the specified &lt;b&gt;boxTypes&lt;/b&gt; until their weight or volume is exhausted, or no valid placements can be found within them for remaining &lt;b&gt;items&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;string&lt;/td&gt;&lt;td&gt;identifies this internal space as being defined by a subspace.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;boxType&lt;/td&gt;&lt;td&gt;BoxType&lt;/td&gt;&lt;td&gt;BoxType definition, values specified are used except price and rate and unless superseded by parent BoxType attributes.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;origin&lt;/td&gt;&lt;td&gt;Point&lt;/td&gt;&lt;td&gt;origin of the subspace relative to Item dimensions.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;blocking&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;whether the bounding box of the internal space blocks placement of other items in the parent box.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the bounding box of the internal space as a white semi-transparent object in the visualization of its containing Item.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;displayChildren&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the children packed within the internal space in the visualization of its containing parent Box.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{ \&quot;operation\&quot;: \&quot;internal-space\&quot;, \&quot;itemRefId\&quot;: 0, \&quot;options\&quot;: {   \&quot;type\&quot;: \&quot;subspace\&quot;,    \&quot;boxType\&quot;: {     \&quot;weightMax\&quot;: 2,     \&quot;name\&quot;: \&quot;flower pot interior\&quot;,     \&quot;price\&quot;: 0,     \&quot;dimensions\&quot;: {       \&quot;x\&quot;: 1.5,       \&quot;y\&quot;: 1.5,       \&quot;z\&quot;: 1.5     }   },   \&quot;origin\&quot;: {     \&quot;x\&quot;: 0.25,     \&quot;y\&quot;: 1,     \&quot;z\&quot;: 1   },   \&quot;blocking\&quot;: true,   \&quot;display\&quot;: true,   \&quot;displayChildren\&quot;: true }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;alternate-dimensions&lt;/h3&gt;     &lt;p&gt;Specify a set of alternate dimensions to attempt when packing in addition to the primary &lt;b&gt;dimensions&lt;/b&gt; attribute of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;dimensions&lt;/td&gt;&lt;td&gt;[]Point&lt;/td&gt;&lt;td&gt;A list of possible dimensions that will be attempted. Dimensions are sorted by volume ascending.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{       \&quot;operation\&quot;: \&quot;alternate-dimensions\&quot;,       \&quot;itemRefId\&quot;: 0,       \&quot;options\&quot;: {         \&quot;dimensions\&quot;: [{           \&quot;x\&quot;: 6,           \&quot;y\&quot;: 8,           \&quot;z\&quot;: 16         },         {           \&quot;x\&quot;: 7.5,           \&quot;y\&quot;: 10,           \&quot;z\&quot;: 10         }]       }     }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;exclude&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all &lt;b&gt;targetItemRefIds&lt;/b&gt;&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;targetItemRefIds\&quot;: [1,2] }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;exclude-all&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all items without its refId&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude-all\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;pack-as-is&lt;/h3&gt;     &lt;p&gt;Each individual item with &lt;b&gt;itemRefId&lt;/b&gt; is packed in a carton matching its exact dimensions, i.e., it is assumed the item is ship-ready and bypasses being placed in a box. If you have an item quantity of 6, it will place the items in 6 boxes.&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;pack-as-is\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;irregular&lt;/h3&gt;     &lt;p&gt;There are two types of irregular item packings right now, \&quot;nesting\&quot; and \&quot;roll\&quot;.&lt;/p&gt;     &lt;ul&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;nesting\&quot;&lt;/h4&gt;          &lt;p&gt;\&quot;nesting\&quot; is where the first item has full dimensions, and subsequent items have diminished dimensions. E.g.,         a flower pot may have dimensions of 6\&quot; x 6\&quot; x 6\&quot;, but additional flower pots can nest in the first pot, and have         effective dimensions of 1\&quot; x 6\&quot; x 6\&quot;. These cases are almost always have a single direction that nesting can occur         in- -two pots must both be right-side up and one on top of the other if they are to nest- -so the rule options must         reflect these restrictions.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;nesting\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsX&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsY&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsZ&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingOrientation&lt;/td&gt;&lt;td&gt;0, 1, or 2&lt;/td&gt;&lt;td&gt;axis index of direction of stacking (0 for vertical/X/\&quot;dinner plates\&quot;, 1 for shorter-horizontal/Y/\&quot;shopping carts\&quot;, 2 for long-horizontal/Z/\&quot;newsstand magazines\&quot;)&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingLimit&lt;/td&gt;&lt;td&gt;&lt;i&gt;integer&lt;/i&gt;&lt;/td&gt;&lt;td&gt;total number of nested items allowed in a single \&quot;stack\&quot;&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;         &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;nesting\&quot;,     \&quot;additionalDimensionsX\&quot;: 1.0,     \&quot;additionalDimensionsY\&quot;: 6.0,     \&quot;additionalDimensionsZ\&quot;: 6.0,     \&quot;nestingOrientation\&quot;: 0,     \&quot;nestingLimit\&quot;: 5   } }&lt;/pre&gt;       &lt;/li&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;roll\&quot;&lt;/h4&gt;          &lt;p&gt;A rolled irregular item is simply where the item dimensions X, Y, and Z, represent the thickness, width, and total         length of a material meant to be rolled up (possibly on a spool, dowel, etc.) and shipped as such. Marked this way, the bounding box         of the roll cylinder will be used as its shipping dimensions. E.g., a roll has a width 60 inches and a diameter of 12 inches,         it will be shipped as if it were a 12\&quot; x 12\&quot; x 60\&quot; item. Rolls can have a maximum allowable diameter, and any rolls that must be         split will have their weights calculated on a pro-rated basis of the total length and weight in the item contents.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;roll\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;innerDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the inner diameter of any dowel or tube used that serves as the initial diameter of the roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;spoolWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the additional weight of each spool or dowel if applicable&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable diameter of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable weight of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;minRollLength&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the minimum length above which rolling will occur. E.g., if less than 12\&quot; remain, ship it flat without rolling.&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;       &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;roll\&quot;,     \&quot;innerDiameter\&quot;: 1.0,     \&quot;spoolWeight\&quot;: 1.0,     \&quot;maxDiameter\&quot;: 8.0,     \&quot;maxWeight\&quot;: 150,     \&quot;minRollLength\&quot;: 12   } }&lt;/pre&gt;       &lt;/li&gt;     &lt;/ul&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;lock-orientation&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is locked from rotation of its original dimensions, with axes of rotation excepted by &lt;b&gt;freeAxes&lt;/b&gt;&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;freeAxes&lt;/td&gt;&lt;td&gt;array&lt;/td&gt;&lt;td&gt;Array of axis indices to be allowed rotational freedom. E.g., [0] for only yaw allowed, [0,1] for yaw and roll.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;lock-orientation\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;freeAxes\&quot;: [0,1]   } }&lt;/pre&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;fragile&lt;/h3&gt;      &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; gains conditions for its packing and the packing of items directly above it. Fragile items can be wrapped in a thickness of packing material that is added to each face of the item, or marked as only to be packed on top of other items, or a maximum weight can be given for all additional items supported by the fragile item, or a simple priority flag can be specified where fraile items with the highest priority are never packed underneath items with a lower or unspecified priority.&lt;p/&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;     &lt;table&gt;       &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;whether to display the virtual subspace created above fragile items for analysis purposes.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum weight of items that may be placed above this fragile item.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;onTopOnly&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;specifies that nothing will be placed between the top dimensions of this item and the top of the box or container it is packed within, overriding &lt;b&gt;maxWeight&lt;/b&gt; if previously specified.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;packingMaterialThickness&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a thickness of padding to apply to each face of the fragile item. E.g., a 3\&quot;x3\&quot;x3\&quot; item with 0.5\&quot; of &lt;b&gt;packingMaterialThickness&lt;/b&gt; will be packed as a 4\&quot;x4\&quot;x4\&quot; volume, as the 0.5\&quot; of material will be applied once to each of the top, bottom, front, back, left, and right sides.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;priority&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a priority integer, where higher values will never be placed underneath lower (or unspecified) values.&lt;/td&gt;&lt;/tr&gt;     &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;fragile\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;display\&quot;: false,     \&quot;onTopOnly\&quot;: false,     \&quot;maxWeight\&quot;: 5,     \&quot;packingMaterialThickness\&quot;: 0.2,     \&quot;priority\&quot;: 0   } }&lt;/pre&gt;   &lt;/li&gt; &lt;/ul&gt; 
        /// </summary>
        /// <value>Rule type for this definition. Valid operation values include &lt;ul&gt;   &lt;li&gt;     &lt;h3&gt;internal-space&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; contains some internal packable subspace that can be used to place subsequent &lt;b&gt;items&lt;/b&gt; defined by a virtual &lt;b&gt;boxType&lt;/b&gt; with an &lt;b&gt;origin&lt;/b&gt; defined relative to the &lt;b&gt;item&lt;/b&gt;&#39;s &lt;b&gt;dimensions&lt;/b&gt; and with an allowable &lt;b&gt;weightMax&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;The internal subspace is subject to all rules and parameters of the parent &lt;b&gt;box&lt;/b&gt; of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;Subspaces may nest, as in a pencil can be placed into a flower pot which may then be put inside a bucket which may then be put inside a single &lt;b&gt;box&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;Internal space subspaces are \&quot;opened\&quot; only when an &lt;b&gt;item&lt;/b&gt; with an internal space is placed into a &lt;b&gt;box&lt;/b&gt;. They are then treated preferentially over opening a new &lt;b&gt;box&lt;/b&gt; from the specified &lt;b&gt;boxTypes&lt;/b&gt; until their weight or volume is exhausted, or no valid placements can be found within them for remaining &lt;b&gt;items&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;string&lt;/td&gt;&lt;td&gt;identifies this internal space as being defined by a subspace.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;boxType&lt;/td&gt;&lt;td&gt;BoxType&lt;/td&gt;&lt;td&gt;BoxType definition, values specified are used except price and rate and unless superseded by parent BoxType attributes.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;origin&lt;/td&gt;&lt;td&gt;Point&lt;/td&gt;&lt;td&gt;origin of the subspace relative to Item dimensions.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;blocking&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;whether the bounding box of the internal space blocks placement of other items in the parent box.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the bounding box of the internal space as a white semi-transparent object in the visualization of its containing Item.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;displayChildren&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the children packed within the internal space in the visualization of its containing parent Box.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{ \&quot;operation\&quot;: \&quot;internal-space\&quot;, \&quot;itemRefId\&quot;: 0, \&quot;options\&quot;: {   \&quot;type\&quot;: \&quot;subspace\&quot;,    \&quot;boxType\&quot;: {     \&quot;weightMax\&quot;: 2,     \&quot;name\&quot;: \&quot;flower pot interior\&quot;,     \&quot;price\&quot;: 0,     \&quot;dimensions\&quot;: {       \&quot;x\&quot;: 1.5,       \&quot;y\&quot;: 1.5,       \&quot;z\&quot;: 1.5     }   },   \&quot;origin\&quot;: {     \&quot;x\&quot;: 0.25,     \&quot;y\&quot;: 1,     \&quot;z\&quot;: 1   },   \&quot;blocking\&quot;: true,   \&quot;display\&quot;: true,   \&quot;displayChildren\&quot;: true }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;alternate-dimensions&lt;/h3&gt;     &lt;p&gt;Specify a set of alternate dimensions to attempt when packing in addition to the primary &lt;b&gt;dimensions&lt;/b&gt; attribute of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;dimensions&lt;/td&gt;&lt;td&gt;[]Point&lt;/td&gt;&lt;td&gt;A list of possible dimensions that will be attempted. Dimensions are sorted by volume ascending.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{       \&quot;operation\&quot;: \&quot;alternate-dimensions\&quot;,       \&quot;itemRefId\&quot;: 0,       \&quot;options\&quot;: {         \&quot;dimensions\&quot;: [{           \&quot;x\&quot;: 6,           \&quot;y\&quot;: 8,           \&quot;z\&quot;: 16         },         {           \&quot;x\&quot;: 7.5,           \&quot;y\&quot;: 10,           \&quot;z\&quot;: 10         }]       }     }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;exclude&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all &lt;b&gt;targetItemRefIds&lt;/b&gt;&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;targetItemRefIds\&quot;: [1,2] }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;exclude-all&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all items without its refId&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude-all\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;pack-as-is&lt;/h3&gt;     &lt;p&gt;Each individual item with &lt;b&gt;itemRefId&lt;/b&gt; is packed in a carton matching its exact dimensions, i.e., it is assumed the item is ship-ready and bypasses being placed in a box. If you have an item quantity of 6, it will place the items in 6 boxes.&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;pack-as-is\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;irregular&lt;/h3&gt;     &lt;p&gt;There are two types of irregular item packings right now, \&quot;nesting\&quot; and \&quot;roll\&quot;.&lt;/p&gt;     &lt;ul&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;nesting\&quot;&lt;/h4&gt;          &lt;p&gt;\&quot;nesting\&quot; is where the first item has full dimensions, and subsequent items have diminished dimensions. E.g.,         a flower pot may have dimensions of 6\&quot; x 6\&quot; x 6\&quot;, but additional flower pots can nest in the first pot, and have         effective dimensions of 1\&quot; x 6\&quot; x 6\&quot;. These cases are almost always have a single direction that nesting can occur         in- -two pots must both be right-side up and one on top of the other if they are to nest- -so the rule options must         reflect these restrictions.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;nesting\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsX&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsY&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsZ&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingOrientation&lt;/td&gt;&lt;td&gt;0, 1, or 2&lt;/td&gt;&lt;td&gt;axis index of direction of stacking (0 for vertical/X/\&quot;dinner plates\&quot;, 1 for shorter-horizontal/Y/\&quot;shopping carts\&quot;, 2 for long-horizontal/Z/\&quot;newsstand magazines\&quot;)&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingLimit&lt;/td&gt;&lt;td&gt;&lt;i&gt;integer&lt;/i&gt;&lt;/td&gt;&lt;td&gt;total number of nested items allowed in a single \&quot;stack\&quot;&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;         &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;nesting\&quot;,     \&quot;additionalDimensionsX\&quot;: 1.0,     \&quot;additionalDimensionsY\&quot;: 6.0,     \&quot;additionalDimensionsZ\&quot;: 6.0,     \&quot;nestingOrientation\&quot;: 0,     \&quot;nestingLimit\&quot;: 5   } }&lt;/pre&gt;       &lt;/li&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;roll\&quot;&lt;/h4&gt;          &lt;p&gt;A rolled irregular item is simply where the item dimensions X, Y, and Z, represent the thickness, width, and total         length of a material meant to be rolled up (possibly on a spool, dowel, etc.) and shipped as such. Marked this way, the bounding box         of the roll cylinder will be used as its shipping dimensions. E.g., a roll has a width 60 inches and a diameter of 12 inches,         it will be shipped as if it were a 12\&quot; x 12\&quot; x 60\&quot; item. Rolls can have a maximum allowable diameter, and any rolls that must be         split will have their weights calculated on a pro-rated basis of the total length and weight in the item contents.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;roll\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;innerDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the inner diameter of any dowel or tube used that serves as the initial diameter of the roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;spoolWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the additional weight of each spool or dowel if applicable&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable diameter of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable weight of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;minRollLength&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the minimum length above which rolling will occur. E.g., if less than 12\&quot; remain, ship it flat without rolling.&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;       &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;roll\&quot;,     \&quot;innerDiameter\&quot;: 1.0,     \&quot;spoolWeight\&quot;: 1.0,     \&quot;maxDiameter\&quot;: 8.0,     \&quot;maxWeight\&quot;: 150,     \&quot;minRollLength\&quot;: 12   } }&lt;/pre&gt;       &lt;/li&gt;     &lt;/ul&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;lock-orientation&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is locked from rotation of its original dimensions, with axes of rotation excepted by &lt;b&gt;freeAxes&lt;/b&gt;&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;freeAxes&lt;/td&gt;&lt;td&gt;array&lt;/td&gt;&lt;td&gt;Array of axis indices to be allowed rotational freedom. E.g., [0] for only yaw allowed, [0,1] for yaw and roll.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;lock-orientation\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;freeAxes\&quot;: [0,1]   } }&lt;/pre&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;fragile&lt;/h3&gt;      &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; gains conditions for its packing and the packing of items directly above it. Fragile items can be wrapped in a thickness of packing material that is added to each face of the item, or marked as only to be packed on top of other items, or a maximum weight can be given for all additional items supported by the fragile item, or a simple priority flag can be specified where fraile items with the highest priority are never packed underneath items with a lower or unspecified priority.&lt;p/&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;     &lt;table&gt;       &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;whether to display the virtual subspace created above fragile items for analysis purposes.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum weight of items that may be placed above this fragile item.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;onTopOnly&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;specifies that nothing will be placed between the top dimensions of this item and the top of the box or container it is packed within, overriding &lt;b&gt;maxWeight&lt;/b&gt; if previously specified.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;packingMaterialThickness&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a thickness of padding to apply to each face of the fragile item. E.g., a 3\&quot;x3\&quot;x3\&quot; item with 0.5\&quot; of &lt;b&gt;packingMaterialThickness&lt;/b&gt; will be packed as a 4\&quot;x4\&quot;x4\&quot; volume, as the 0.5\&quot; of material will be applied once to each of the top, bottom, front, back, left, and right sides.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;priority&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a priority integer, where higher values will never be placed underneath lower (or unspecified) values.&lt;/td&gt;&lt;/tr&gt;     &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;fragile\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;display\&quot;: false,     \&quot;onTopOnly\&quot;: false,     \&quot;maxWeight\&quot;: 5,     \&quot;packingMaterialThickness\&quot;: 0.2,     \&quot;priority\&quot;: 0   } }&lt;/pre&gt;   &lt;/li&gt; &lt;/ul&gt; </value>
        [DataMember(Name="operation", EmitDefaultValue=false)]
        public OperationEnum Operation { get; set; }
        /// <summary>
        /// Initializes a new instance of the <see cref="Rule" /> class.
        /// </summary>
        [JsonConstructorAttribute]
        protected Rule() { }
        /// <summary>
        /// Initializes a new instance of the <see cref="Rule" /> class.
        /// </summary>
        /// <param name="itemRefId">reference ID for the item the rule applies to..</param>
        /// <param name="targetItemRefIds">target item reference IDs that the rule applies to..</param>
        /// <param name="operation">Rule type for this definition. Valid operation values include &lt;ul&gt;   &lt;li&gt;     &lt;h3&gt;internal-space&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; contains some internal packable subspace that can be used to place subsequent &lt;b&gt;items&lt;/b&gt; defined by a virtual &lt;b&gt;boxType&lt;/b&gt; with an &lt;b&gt;origin&lt;/b&gt; defined relative to the &lt;b&gt;item&lt;/b&gt;&#39;s &lt;b&gt;dimensions&lt;/b&gt; and with an allowable &lt;b&gt;weightMax&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;The internal subspace is subject to all rules and parameters of the parent &lt;b&gt;box&lt;/b&gt; of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;Subspaces may nest, as in a pencil can be placed into a flower pot which may then be put inside a bucket which may then be put inside a single &lt;b&gt;box&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;Internal space subspaces are \&quot;opened\&quot; only when an &lt;b&gt;item&lt;/b&gt; with an internal space is placed into a &lt;b&gt;box&lt;/b&gt;. They are then treated preferentially over opening a new &lt;b&gt;box&lt;/b&gt; from the specified &lt;b&gt;boxTypes&lt;/b&gt; until their weight or volume is exhausted, or no valid placements can be found within them for remaining &lt;b&gt;items&lt;/b&gt;.&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;string&lt;/td&gt;&lt;td&gt;identifies this internal space as being defined by a subspace.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;boxType&lt;/td&gt;&lt;td&gt;BoxType&lt;/td&gt;&lt;td&gt;BoxType definition, values specified are used except price and rate and unless superseded by parent BoxType attributes.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;origin&lt;/td&gt;&lt;td&gt;Point&lt;/td&gt;&lt;td&gt;origin of the subspace relative to Item dimensions.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;blocking&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;whether the bounding box of the internal space blocks placement of other items in the parent box.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the bounding box of the internal space as a white semi-transparent object in the visualization of its containing Item.&lt;/td&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;displayChildren&lt;/td&gt;&lt;td&gt;boolean&lt;/td&gt;&lt;td&gt;option to display the children packed within the internal space in the visualization of its containing parent Box.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{ \&quot;operation\&quot;: \&quot;internal-space\&quot;, \&quot;itemRefId\&quot;: 0, \&quot;options\&quot;: {   \&quot;type\&quot;: \&quot;subspace\&quot;,    \&quot;boxType\&quot;: {     \&quot;weightMax\&quot;: 2,     \&quot;name\&quot;: \&quot;flower pot interior\&quot;,     \&quot;price\&quot;: 0,     \&quot;dimensions\&quot;: {       \&quot;x\&quot;: 1.5,       \&quot;y\&quot;: 1.5,       \&quot;z\&quot;: 1.5     }   },   \&quot;origin\&quot;: {     \&quot;x\&quot;: 0.25,     \&quot;y\&quot;: 1,     \&quot;z\&quot;: 1   },   \&quot;blocking\&quot;: true,   \&quot;display\&quot;: true,   \&quot;displayChildren\&quot;: true }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;alternate-dimensions&lt;/h3&gt;     &lt;p&gt;Specify a set of alternate dimensions to attempt when packing in addition to the primary &lt;b&gt;dimensions&lt;/b&gt; attribute of the &lt;b&gt;item&lt;/b&gt;.     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;dimensions&lt;/td&gt;&lt;td&gt;[]Point&lt;/td&gt;&lt;td&gt;A list of possible dimensions that will be attempted. Dimensions are sorted by volume ascending.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{       \&quot;operation\&quot;: \&quot;alternate-dimensions\&quot;,       \&quot;itemRefId\&quot;: 0,       \&quot;options\&quot;: {         \&quot;dimensions\&quot;: [{           \&quot;x\&quot;: 6,           \&quot;y\&quot;: 8,           \&quot;z\&quot;: 16         },         {           \&quot;x\&quot;: 7.5,           \&quot;y\&quot;: 10,           \&quot;z\&quot;: 10         }]       }     }&lt;/pre&gt;   &lt;/li&gt;    &lt;li&gt;     &lt;h3&gt;exclude&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all &lt;b&gt;targetItemRefIds&lt;/b&gt;&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;targetItemRefIds\&quot;: [1,2] }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;exclude-all&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is excluded from being packed in the same carton with all items without its refId&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;exclude-all\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;pack-as-is&lt;/h3&gt;     &lt;p&gt;Each individual item with &lt;b&gt;itemRefId&lt;/b&gt; is packed in a carton matching its exact dimensions, i.e., it is assumed the item is ship-ready and bypasses being placed in a box. If you have an item quantity of 6, it will place the items in 6 boxes.&lt;/p&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;pack-as-is\&quot;,   \&quot;itemRefId\&quot;: 0 }&lt;/pre&gt;     &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;irregular&lt;/h3&gt;     &lt;p&gt;There are two types of irregular item packings right now, \&quot;nesting\&quot; and \&quot;roll\&quot;.&lt;/p&gt;     &lt;ul&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;nesting\&quot;&lt;/h4&gt;          &lt;p&gt;\&quot;nesting\&quot; is where the first item has full dimensions, and subsequent items have diminished dimensions. E.g.,         a flower pot may have dimensions of 6\&quot; x 6\&quot; x 6\&quot;, but additional flower pots can nest in the first pot, and have         effective dimensions of 1\&quot; x 6\&quot; x 6\&quot;. These cases are almost always have a single direction that nesting can occur         in- -two pots must both be right-side up and one on top of the other if they are to nest- -so the rule options must         reflect these restrictions.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;nesting\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsX&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsY&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;additionalDimensionsZ&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingOrientation&lt;/td&gt;&lt;td&gt;0, 1, or 2&lt;/td&gt;&lt;td&gt;axis index of direction of stacking (0 for vertical/X/\&quot;dinner plates\&quot;, 1 for shorter-horizontal/Y/\&quot;shopping carts\&quot;, 2 for long-horizontal/Z/\&quot;newsstand magazines\&quot;)&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;nestingLimit&lt;/td&gt;&lt;td&gt;&lt;i&gt;integer&lt;/i&gt;&lt;/td&gt;&lt;td&gt;total number of nested items allowed in a single \&quot;stack\&quot;&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;         &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;nesting\&quot;,     \&quot;additionalDimensionsX\&quot;: 1.0,     \&quot;additionalDimensionsY\&quot;: 6.0,     \&quot;additionalDimensionsZ\&quot;: 6.0,     \&quot;nestingOrientation\&quot;: 0,     \&quot;nestingLimit\&quot;: 5   } }&lt;/pre&gt;       &lt;/li&gt;       &lt;li&gt;         &lt;h4&gt;\&quot;roll\&quot;&lt;/h4&gt;          &lt;p&gt;A rolled irregular item is simply where the item dimensions X, Y, and Z, represent the thickness, width, and total         length of a material meant to be rolled up (possibly on a spool, dowel, etc.) and shipped as such. Marked this way, the bounding box         of the roll cylinder will be used as its shipping dimensions. E.g., a roll has a width 60 inches and a diameter of 12 inches,         it will be shipped as if it were a 12\&quot; x 12\&quot; x 60\&quot; item. Rolls can have a maximum allowable diameter, and any rolls that must be         split will have their weights calculated on a pro-rated basis of the total length and weight in the item contents.&lt;p/&gt;         &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;         &lt;table&gt;           &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;type&lt;/td&gt;&lt;td&gt;\&quot;roll\&quot;&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;innerDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the inner diameter of any dowel or tube used that serves as the initial diameter of the roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;spoolWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the additional weight of each spool or dowel if applicable&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxDiameter&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable diameter of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum acceptable weight of a resultant roll.&lt;/td&gt;&lt;/tr&gt;           &lt;tr&gt;&lt;td&gt;minRollLength&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the minimum length above which rolling will occur. E.g., if less than 12\&quot; remain, ship it flat without rolling.&lt;/td&gt;&lt;/tr&gt;         &lt;/table&gt;       &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;irregular\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;type\&quot;: \&quot;roll\&quot;,     \&quot;innerDiameter\&quot;: 1.0,     \&quot;spoolWeight\&quot;: 1.0,     \&quot;maxDiameter\&quot;: 8.0,     \&quot;maxWeight\&quot;: 150,     \&quot;minRollLength\&quot;: 12   } }&lt;/pre&gt;       &lt;/li&gt;     &lt;/ul&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;lock-orientation&lt;/h3&gt;     &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; is locked from rotation of its original dimensions, with axes of rotation excepted by &lt;b&gt;freeAxes&lt;/b&gt;&lt;/p&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;        &lt;table&gt;          &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;          &lt;tr&gt;&lt;td&gt;freeAxes&lt;/td&gt;&lt;td&gt;array&lt;/td&gt;&lt;td&gt;Array of axis indices to be allowed rotational freedom. E.g., [0] for only yaw allowed, [0,1] for yaw and roll.&lt;/td&gt;&lt;/tr&gt;        &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;lock-orientation\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;freeAxes\&quot;: [0,1]   } }&lt;/pre&gt;   &lt;/li&gt;   &lt;li&gt;     &lt;h3&gt;fragile&lt;/h3&gt;      &lt;p&gt;&lt;b&gt;itemRefId&lt;/b&gt; gains conditions for its packing and the packing of items directly above it. Fragile items can be wrapped in a thickness of packing material that is added to each face of the item, or marked as only to be packed on top of other items, or a maximum weight can be given for all additional items supported by the fragile item, or a simple priority flag can be specified where fraile items with the highest priority are never packed underneath items with a lower or unspecified priority.&lt;p/&gt;     &lt;p&gt;&lt;b&gt;\&quot;options\&quot;&lt;/b&gt; contents:&lt;/p&gt;     &lt;table&gt;       &lt;tr&gt;&lt;th&gt;key&lt;/th&gt;&lt;th&gt;value&lt;/th&gt;&lt;th&gt;description&lt;/th&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;display&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;whether to display the virtual subspace created above fragile items for analysis purposes.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;maxWeight&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;the maximum weight of items that may be placed above this fragile item.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;onTopOnly&lt;/td&gt;&lt;td&gt;&lt;i&gt;boolean&lt;/i&gt;&lt;/td&gt;&lt;td&gt;specifies that nothing will be placed between the top dimensions of this item and the top of the box or container it is packed within, overriding &lt;b&gt;maxWeight&lt;/b&gt; if previously specified.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;packingMaterialThickness&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a thickness of padding to apply to each face of the fragile item. E.g., a 3\&quot;x3\&quot;x3\&quot; item with 0.5\&quot; of &lt;b&gt;packingMaterialThickness&lt;/b&gt; will be packed as a 4\&quot;x4\&quot;x4\&quot; volume, as the 0.5\&quot; of material will be applied once to each of the top, bottom, front, back, left, and right sides.&lt;/td&gt;&lt;/tr&gt;       &lt;tr&gt;&lt;td&gt;priority&lt;/td&gt;&lt;td&gt;&lt;i&gt;number&lt;/i&gt;&lt;/td&gt;&lt;td&gt;FUTURE RELEASE&amp;mdash;a priority integer, where higher values will never be placed underneath lower (or unspecified) values.&lt;/td&gt;&lt;/tr&gt;     &lt;/table&gt;     &lt;pre&gt;{   \&quot;operation\&quot;: \&quot;fragile\&quot;,   \&quot;itemRefId\&quot;: 0,   \&quot;options\&quot;: {     \&quot;display\&quot;: false,     \&quot;onTopOnly\&quot;: false,     \&quot;maxWeight\&quot;: 5,     \&quot;packingMaterialThickness\&quot;: 0.2,     \&quot;priority\&quot;: 0   } }&lt;/pre&gt;   &lt;/li&gt; &lt;/ul&gt;  (required).</param>
        /// <param name="options">additional key-value options to pass for rule based on operation type..</param>
        /// <param name="parameters">array of supplementary parameters to pass for rule, mostly deprecated. may be different from options..</param>
        public Rule(int? itemRefId = default(int?), List<int?> targetItemRefIds = default(List<int?>), OperationEnum operation = default(OperationEnum), Object options = default(Object), List<string> parameters = default(List<string>))
        {
            // to ensure "operation" is required (not null)
            if (operation == null)
            {
                throw new InvalidDataException("operation is a required property for Rule and cannot be null");
            }
            else
            {
                this.Operation = operation;
            }
            this.ItemRefId = itemRefId;
            this.TargetItemRefIds = targetItemRefIds;
            this.Options = options;
            this.Parameters = parameters;
        }
        
        /// <summary>
        /// reference ID for the item the rule applies to.
        /// </summary>
        /// <value>reference ID for the item the rule applies to.</value>
        [DataMember(Name="itemRefId", EmitDefaultValue=false)]
        public int? ItemRefId { get; set; }

        /// <summary>
        /// target item reference IDs that the rule applies to.
        /// </summary>
        /// <value>target item reference IDs that the rule applies to.</value>
        [DataMember(Name="targetItemRefIds", EmitDefaultValue=false)]
        public List<int?> TargetItemRefIds { get; set; }


        /// <summary>
        /// additional key-value options to pass for rule based on operation type.
        /// </summary>
        /// <value>additional key-value options to pass for rule based on operation type.</value>
        [DataMember(Name="options", EmitDefaultValue=false)]
        public Object Options { get; set; }

        /// <summary>
        /// array of supplementary parameters to pass for rule, mostly deprecated. may be different from options.
        /// </summary>
        /// <value>array of supplementary parameters to pass for rule, mostly deprecated. may be different from options.</value>
        [DataMember(Name="parameters", EmitDefaultValue=false)]
        public List<string> Parameters { get; set; }

        /// <summary>
        /// Returns the string presentation of the object
        /// </summary>
        /// <returns>String presentation of the object</returns>
        public override string ToString()
        {
            var sb = new StringBuilder();
            sb.Append("class Rule {\n");
            sb.Append("  ItemRefId: ").Append(ItemRefId).Append("\n");
            sb.Append("  TargetItemRefIds: ").Append(TargetItemRefIds).Append("\n");
            sb.Append("  Operation: ").Append(Operation).Append("\n");
            sb.Append("  Options: ").Append(Options).Append("\n");
            sb.Append("  Parameters: ").Append(Parameters).Append("\n");
            sb.Append("}\n");
            return sb.ToString();
        }
  
        /// <summary>
        /// Returns the JSON string presentation of the object
        /// </summary>
        /// <returns>JSON string presentation of the object</returns>
        public virtual string ToJson()
        {
            return JsonConvert.SerializeObject(this, Formatting.Indented);
        }

        /// <summary>
        /// Returns true if objects are equal
        /// </summary>
        /// <param name="input">Object to be compared</param>
        /// <returns>Boolean</returns>
        public override bool Equals(object input)
        {
            return this.Equals(input as Rule);
        }

        /// <summary>
        /// Returns true if Rule instances are equal
        /// </summary>
        /// <param name="input">Instance of Rule to be compared</param>
        /// <returns>Boolean</returns>
        public bool Equals(Rule input)
        {
            if (input == null)
                return false;

            return 
                (
                    this.ItemRefId == input.ItemRefId ||
                    (this.ItemRefId != null &&
                    this.ItemRefId.Equals(input.ItemRefId))
                ) && 
                (
                    this.TargetItemRefIds == input.TargetItemRefIds ||
                    this.TargetItemRefIds != null &&
                    this.TargetItemRefIds.SequenceEqual(input.TargetItemRefIds)
                ) && 
                (
                    this.Operation == input.Operation ||
                    (this.Operation != null &&
                    this.Operation.Equals(input.Operation))
                ) && 
                (
                    this.Options == input.Options ||
                    (this.Options != null &&
                    this.Options.Equals(input.Options))
                ) && 
                (
                    this.Parameters == input.Parameters ||
                    this.Parameters != null &&
                    this.Parameters.SequenceEqual(input.Parameters)
                );
        }

